import React from "react";
import { Section } from "./styles.js";

export default function Home() {
  return (
    <Section>
      <div className="BoxTop">
        <div>
          <h1>Blog da Rocketseat</h1>
          <br/>
          Junte-se a milhares de devs e acelere na direção
          dos seus objetivos. Transforme sua carreira em uma jornada de evolução
          contínua através das melhores tecnologias.
        </div>
      </div>
    </Section>
  );
}
